import React, { Component } from 'react';
import '../styles/guest.css';

import tasks from '../../../server/task.json';

class guest extends Component{

    state = {
        tasks: tasks
    }

    render(){
        return <div>

        {this.state.tasks.map(e => <h1>{e.departamentos.departamento.nombre}</h1>)}

        </div>
    }
}

export default guest;
